var tipuesearch = {"pages": [{'title': 'About', 'text': '我的倉儲\xa0 https://github.com/40923106/wcm2021 \n 我的github網站\xa0 https://40923106.github.io/wcm2021/content/index.html \n 我的heroku網站\xa0 https://s40923106.herokuapp.com/content/index.html \n \n', 'tags': '', 'url': 'About.html'}, {'title': '每周進度', 'text': '\n', 'tags': '', 'url': '每周進度.html'}, {'title': 'W1 W2', 'text': '建立WCM2021的倉儲 \n \n', 'tags': '', 'url': 'W1 W2.html'}, {'title': 'W3', 'text': '到 mde tw 的 cmstemplate 的網站中 \n 即可了解到建立倉儲中常見的問題 \n \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '學校的課程相關主機為\xa0 https://qry.nfu.edu.tw/ \n 查詢各班課表用\xa0 https://qry.nfu.edu.tw/class.php \n 再使用spring v2 ipv6 去拉出四設計一甲班及課表 \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': '學習如何設定用ssh對github連線 \n 雖然在大一上學期的cp2020中已經講解過ssh(如下面的網址) \n http://mde.tw/cp2020/content/SSH.html \n 也說過如何設置ssh對github連線， 不過因不熟悉如何操作，所以在本周重新再設定一次( 如下面的網址 ) \n http://mde.tw/cd2021/content/SSH%20%E4%BA%86%E6%B2%92.html \n 下列為老師所拍攝的教學影片 \n \n \n \n 4/1 在heroku上創建一個帳號，去a.kmol.info.88，下載heroku.7z至隨身系統中，如下面網址操作 \n http://mde.tw/lab/content/Heroku.html \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6W7', 'text': '操作heroku使其跟github同步 \n \n', 'tags': '', 'url': 'W6W7.html'}, {'title': 'W8', 'text': '開始製作分組專題 \n 先了解Topic0  http://mde.tw/wcm2021/content/Topic%200.html \xa0中怎麼從學校教務主機拉出我們班四設計一甲的課表 \n 也拉出實驗室排時間的課表\xa0 http://mde.tw/wcm2021/content/W7.html \xa0如此網址所述 \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '期中分組報告 \n \n', 'tags': '', 'url': 'W9.html'}, {'title': 'W10', 'text': '重新設定ssh\xa0 \n \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11 W12', 'text': '下載robodk這個程式 \n \n', 'tags': '', 'url': 'W11 W12.html'}, {'title': 'W13', 'text': '開始使用 Google Meet 遠距上課 \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '操作 Robodk 這個程式，並看看能不能正常運作 \n \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '小組錄製討論畫面 \n 並放到分組網站上 \n \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16', 'text': '操作 Fossil，建立靜態網頁，使其與github同步 \n \n 小組操作影片網址 \n https://www.youtube.com/watch?v=qg9JmMrDFNw \n https://www.youtube.com/watch?v=b4gaPmvRxHM \n https://www.youtube.com/watch?v=vZg9ktF6GQ \n \n 我的fossil網站\xa0 https://fossil.kmol.info/u/40923106/home \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 https://fossil.kmol.info/u/40923106/doc/trunk/content/index.html \n \n 以下為fossil的操作指令 \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W16.html'}, {'title': 'W17', 'text': '跟老師及同學分享自己這學期網際網路課程的學習成果 \n \n', 'tags': '', 'url': 'W17.html'}, {'title': '網路環境', 'text': '\n 之前在學校都是利用學校網路進行更新， 因為疫情需要遠距教學，所以要改網路才能夠push \n \n 因為是使用自己的網路，所以需要把 Proxy 的 Proxy type 選項改為 None \n \n \n \n', 'tags': '', 'url': '網路環境.html'}, {'title': 'Heroku 網站', 'text': '1. \xa0 ( 建立 Heroku 帳號 ) 進入 \xa0 https://heroku.com , 利用學校的 @gm 註冊一個 Heroku 帳號 \n 2. ( 建立 Heroku app ) 登入 Heroku 後，先以 s + 學號 建立第一個 app \n 3.\xa0 (下載 Heroku CLI) 從 \xa0 http://a.kmol.info:88/heroku.7z \xa0 下載 Heroku cli 程式檔案，解開至隨身碟 Y: 所在位置 \n 4.\xa0 ( 修改命令搜尋路徑 ) 修改隨身系統的啟動批次檔案, 讓 Windows 的命令視窗中可以執行 heroku.exe，重新啟動已經納入可執行 heroku.exe 的隨身碟 start_ipv6.bat 或 start_ipv4.bat中 \n 5.( 測試 heroku 執行 ) 重新打開start_ipv6.bat，在命令列中執行輸入 heroku version，如果有回應表示有設定成功 \n \n \n 6.( 設定 heroku 代理主機 ) 在 y:\\home_ipv6 下的 .giconfig 中， 以 git config --global http.proxy "http://your_proxy:port" 進行設定 \n \n 在 start_ipv6.bat 中加入: \n \n \n \n \n \n \n 1 \n 2 \n 3 \n \n \n \n REM  for   heroku login \n REM set HTTP_PROXY=http: //[2001:288:6004:17::53]:3128 \n REM set HTTPS_PROXY=http: //[2001:288:6004:17::53]:3128 \n \n \n \n \n \n \n 因為是用自己得網路，所以要在前面打REM變成註解 \n \n \n \n \n \n 7.( 設定同步倉儲 ) 透過 git remote add (Heroku 指令為 heroku git:remote -a heroku_倉儲_名稱, 之後只要在 heroku login 狀態下, 可以直接利用 git push) 在近端設定一個連線到 Heroku 倉儲的代號, 就能在每次更新 Github Pages 倉儲後, 再將內容同步至 Heroku \n \n 8.( 以 git 進行提交推送 ) 只要使用 git push heroku 就可以將改版內容推送到對應的 Heroku app 倉儲 \n \n \n \n \n', 'tags': '', 'url': 'Heroku 網站.html'}, {'title': '網路直播', 'text': '接下來要講解如何用 OBS+YouTube 進行直播 \n \n 1.點選右上角的攝影機按鈕並點選進行直播 \n \n \n \n \n \n \n 2. 如果是第一次進行直播需要驗證後等24小時才能啟用直播 \n \n \n \n \n \n \n 3.輸入標題及其他一些設定，完成後點選繼續 \n \n \n \n \n \n \n 4.將串流設定中的串流金鑰複製 \n \n \n \n \n \n \n 5.進到OBS中的設定，點選串流，服務選YouTube，伺服器選Primary YouTube ingest server，然後將剛剛複製的串流金鑰貼上，點選套用和確定 \n \n \n \n \n \n \n 6.接著點選一般，勾選串流時自動錄製，按下套用及確定 \n \n \n \n \n \n \n 7.接著點選輸出，設定錄影路徑，綠影格式選mp4，好了後點選套用及確定 \n \n \n \n \n \n \n 8.點選開始串流 \n \n \n \n \n \n \n 9.回到YouTube畫面，此時YouTube的直播畫面就會和OBS同步顯示並且進行直播 \n \n \n \n \n \n \n \n', 'tags': '', 'url': '網路直播.html'}, {'title': 'RoboDk執行', 'text': '\n \n 1.我是用自己的網路操作Robodk，所以要先找到ipv4的位置，在命令列打ipconfig /all，即可找到自己ipv4的位置 \n \n \n \n \n \n \n 2.接著把robodk522_protable>example>pick_and_place裡面的pick_and_place.py拉到SciTE裡，在Robolink裡打入自己的ipv4位置 \n \n \n \n \n \n \n \n 3.打開Robodk.exe，按左上角的資料夾圖案，選取example中除了pick_and_place.py之外的其他檔案後開啟 \n \n \n \n \n \n 4.按工具>選項 \n \n \n \n \n \n 5.打開選項後，勾取允許外部API \n \n \n \n \n \n 6.點選API服務器IP後，確定網路位置是正確的ipv4位置後按OK \n \n \n \n 7.回到pick_and_place.py的SciTE中點選Tools Go，即可啟用Robodk \n \n \n \n', 'tags': '', 'url': 'RoboDk執行.html'}]};